var client = new SeedObjectsWithImportsClient();
await client.Optional.SendOptionalBodyAsync(
    new Dictionary<string, object?>()
    {
        {
            "string",
            new Dictionary<object, object?>() { { "key", "value" } }
        },
    }
);

